INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60000, "", 1, 1, 1, 1, "カリン", 190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60000, "", 0, 2, 1, 2, "", 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60000, "", 0, 2, 1, 3, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60000, "", 0, 2, 2, 4, "", 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60000, "", 0, 2, 1, 5, "", 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60000, "", 0, 2, 1, 6, "", 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60000, "", 0, 2, 2, 7, "", 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60000, "", 0, 2, 1, 8, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60000, "", 0, 2, 1, 9, "", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60000, "", 0, 2, 1, 10, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60000, "", 0, 2, 1, 11, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60000, "", 0, 2, 2, 12, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60000, "", 0, 2, 1, 13, "", 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60000, "", 0, 2, 1, 14, "", 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60000, "", 0, 2, 1, 15, "", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60000, "", 0, 2, 1, 16, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60000, "", 0, 2, 2, 17, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60000, "", 2, 3, 0, 18, "カリン", 190804, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60000, "", 3, 3, 0, 19, "カリン", 190804, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 20, "ハツネ", 101201, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 21, "ハツネ", 101201, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 22, "シオリ", 103801, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 23, "シオリ", 103801, "来年も、\n一緒にいられたら…\nうれしいな", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 24, "キョウカ", 103601, "あなたと一緒にいるようになって、\nもう1年ですか…", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 25, "キョウカ", 103601, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 26, "ミミ", 102001, "おにいちゃんとあってから、\n1年たったよ～！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 27, "ミミ", 102001, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 2, 0, 28, "ミソギ", 100401, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 2, 0, 29, "ミソギ", 100401, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 30, "マホ", 101001, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 31, "マホ", 101001, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 32, "イリヤ", 104401, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 33, "イリヤ", 104401, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 2, 0, 34, "カオリ", 101701, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 2, 0, 35, "カオリ", 101701, "これからも、どうぞよろしく\nお願いするさ～！", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 36, "サレン", 102801, "あんたと出会ってからもうそんなに\nたつのね～", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 37, "サレン", 102801, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 38, "スズメ", 102501, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 39, "スズメ", 102501, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 40, "タマキ", 104601, "振り返れば、今までいろんなことが\nあったにゃあ…", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 41, "タマキ", 104601, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 42, "ミフユ", 104801, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 43, "ミフユ", 104801, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 44, "アキノ", 103201, "あなたさまと出会ってもう1年…", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 45, "アキノ", 103201, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 46, "ユカリ", 103401, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 47, "ユカリ", 103401, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 48, "クリスティーナ", 107101, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 49, "クリスティーナ", 107101, "ともかくこれからも\n愉しませてくれよ☆", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 50, "ジュン", 104701, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 51, "ジュン", 104701, "見えないから分からないって？\nそれもそうだな…", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 52, "トモ", 103701, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 53, "トモ", 103701, "これからもよろしくね！", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 54, "マツリ", 100501, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 55, "マツリ", 100501, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 56, "ミヤコ", 100701, "オマエと会って1年なの！\n全然成仏もできなかったし、", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 57, "ミヤコ", 100701, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 58, "シノブ", 103101, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 59, "シノブ", 103101, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 60, "アンナ", 100901, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 61, "アンナ", 100901, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 62, "ナナカ", 101301, "君と出会ってもう1年だって！\n早いねー！", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 63, "ナナカ", 101301, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 64, "ミツキ", 105101, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 65, "ミツキ", 105101, "これからも、いろんなところを\n調べさせてね？", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 66, "ルカ", 105601, "お前さんと出会ってもう1年か\n助太刀するつもりが", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 67, "ルカ", 105601, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 2, 0, 68, "エリコ", 102701, "早いものですわね、あなた様と\nお会いして、もう1年…", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 2, 0, 69, "エリコ", 102701, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 70, "アヤネ", 102301, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 71, "アヤネ", 102301, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 72, "チカ", 104201, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 73, "チカ", 104201, "私のことを見守ってください\nできることなら、ずっと…", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 2, 0, 74, "クルミ", 102101, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 2, 0, 75, "クルミ", 102101, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 76, "シズル", 104901, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 77, "シズル", 104901, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 78, "リノ", 101101, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 79, "リノ", 101101, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 80, "ユイ", 100201, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 81, "ユイ", 100201, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 82, "ヒヨリ", 100101, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 83, "ヒヨリ", 100101, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 2, 0, 84, "レイ", 100301, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 2, 0, 85, "レイ", 100301, "キミに背中を預けられる日が、\n早くきますように", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 0, 0, 86, "ペコリーヌ", 105801, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 0, 0, 87, "ペコリーヌ", 105801, "これからもずっと、覚えていて\nくださいね！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 1, 0, 88, "コッコロ", 105901, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 1, 0, 89, "コッコロ", 105901, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 1, 2, 0, 90, "キャル", 106001, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80001, "", 2, 2, 0, 91, "キャル", 106001, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60001, "", 1, 1, 1, 92, "スズメ", 112101, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60001, "", 0, 2, 1, 93, "", 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60001, "", 0, 2, 1, 94, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60001, "", 0, 2, 1, 95, "", 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60001, "", 0, 2, 1, 96, "", 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60001, "", 0, 2, 2, 97, "", 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60001, "", 0, 2, 1, 98, "", 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60001, "", 0, 2, 1, 99, "", 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60001, "", 0, 2, 1, 100, "", 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60001, "", 0, 2, 1, 101, "", 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60001, "", 0, 2, 2, 102, "", 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60001, "", 0, 2, 1, 103, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60001, "", 0, 2, 1, 104, "", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60001, "", 0, 2, 1, 105, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60001, "", 0, 2, 1, 106, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60001, "", 0, 2, 1, 107, "", 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60001, "", 0, 2, 1, 108, "", 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60001, "", 0, 2, 2, 109, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60001, "", 0, 2, 1, 110, "", 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60001, "", 0, 2, 1, 111, "", 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60001, "", 0, 2, 1, 112, "", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60001, "", 0, 2, 1, 113, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60001, "", 0, 2, 1, 114, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60001, "", 0, 2, 1, 115, "", 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60001, "", 0, 2, 2, 116, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60001, "", 2, 3, 0, 117, "スズメ", 112101, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60001, "", 3, 3, 0, 118, "スズメ", 112101, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 1, 0, 0, 119, "ペコリーヌ", 105801, "ヒューヒュー♪\nドンドンパフパフー♪", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 1, 1, 0, 120, "コッコロ", 105901, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 2, 1, 0, 121, "コッコロ", 105901, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 1, 2, 0, 122, "キャル", 106001, "え？　ちょっと\nいきなりなにっ？", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 2, 2, 0, 123, "キャル", 106001, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 2, 0, 0, 124, "ペコリーヌ", 105801, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 3, 0, 0, 125, "ペコリーヌ", 105801, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 3, 1, 0, 126, "コッコロ", 105901, "ですからその日に向けて\n今から気分を盛り上げているのです", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 3, 2, 0, 127, "キャル", 106001, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 4, 1, 0, 128, "コッコロ", 105901, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 4, 0, 0, 129, "ペコリーヌ", 105801, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 4, 2, 0, 130, "キャル", 106001, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 5, 1, 0, 131, "コッコロ", 105901, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 5, 0, 0, 132, "キャル", 106001, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 1, 1, 0, 133, "カリン", 190801, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 6, 0, 0, 134, "キャル", 106001, "げっ…カリンじゃない\nなんでもないわよ！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 2, 1, 0, 135, "カリン", 190801, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 7, 0, 0, 136, "キャル", 106001, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 3, 1, 0, 137, "カリン", 190801, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 8, 0, 0, 138, "キャル", 106001, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 9, 0, 0, 139, "キャル", 106001, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 4, 1, 0, 140, "カリン", 190801, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 10, 0, 0, 141, "キャル", 106001, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 5, 1, 0, 142, "カリン", 190801, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 11, 0, 0, 143, "キャル", 106001, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 6, 0, 0, 144, "コッコロ", 105901, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 5, 1, 0, 145, "ペコリーヌ", 105801, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 7, 0, 0, 146, "コッコロ", 105901, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 8, 0, 0, 147, "コッコロ", 105901, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 6, 1, 0, 148, "ペコリーヌ", 105801, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 7, 1, 0, 149, "ペコリーヌ", 105801, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 9, 0, 0, 150, "コッコロ", 105901, "あとは、牧場に素敵な温泉が\n出来たとか…", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 8, 1, 0, 151, "ペコリーヌ", 105801, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 10, 0, 0, 152, "コッコロ", 105901, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 9, 1, 0, 153, "ペコリーヌ", 105801, "えへへ、ありがとうございます\nコッコロちゃん！", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 11, 0, 0, 154, "コッコロ", 105901, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 10, 1, 0, 155, "ペコリーヌ", 105801, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 11, 0, 0, 156, "ペコリーヌ", 105801, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 12, 1, 0, 157, "キャル", 106001, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 12, 0, 0, 158, "ペコリーヌ", 105801, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 13, 1, 0, 159, "キャル", 106001, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 13, 0, 0, 160, "ペコリーヌ", 105801, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 14, 1, 0, 161, "キャル", 106001, "…積極的？\nなんの話よ？", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 14, 0, 0, 162, "ペコリーヌ", 105801, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 15, 0, 0, 163, "ペコリーヌ", 105801, "ムーサの町で\nきゃるきゃる～ん☆　って！", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 15, 1, 0, 164, "キャル", 106001, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 16, 0, 0, 165, "ペコリーヌ", 105801, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 16, 1, 0, 166, "キャル", 106001, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 17, 1, 0, 167, "キャル", 106001, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 18, 0, 0, 168, "キャル", 106001, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 12, 1, 0, 169, "コッコロ", 105901, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 19, 0, 0, 170, "キャル", 106001, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 13, 1, 0, 171, "コッコロ", 105901, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 20, 0, 0, 172, "キャル", 106001, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 14, 1, 0, 173, "コッコロ", 105901, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 21, 0, 0, 174, "キャル", 106001, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 15, 1, 0, 175, "コッコロ", 105901, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 22, 0, 0, 176, "キャル", 106001, "かくし芸？", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 16, 1, 0, 177, "コッコロ", 105901, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 23, 0, 0, 178, "キャル", 106001, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 17, 0, 0, 179, "ペコリーヌ", 105801, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 24, 2, 0, 180, "キャル", 106001, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 17, 1, 0, 181, "コッコロ", 105901, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 18, 0, 0, 182, "ペコリーヌ", 105801, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 25, 2, 0, 183, "キャル", 106001, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 18, 1, 0, 184, "コッコロ", 105901, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 26, 2, 0, 185, "キャル", 106001, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 27, 2, 0, 186, "キャル", 106001, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 28, 2, 0, 187, "キャル", 106001, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 19, 0, 0, 188, "ペコリーヌ", 105801, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 19, 1, 0, 189, "コッコロ", 105901, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 29, 2, 0, 190, "キャル", 106001, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 30, 0, 0, 191, "キャル", 106001, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 31, 0, 0, 192, "キャル", 106001, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 32, 0, 0, 193, "キャル", 106001, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 33, 0, 0, 194, "キャル", 106001, "あー\nあー\n…声、これで大丈夫かしら？", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 34, 0, 0, 195, "キャル", 106001, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 35, 0, 0, 196, "キャル", 106001, "オイッスー☆", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 36, 0, 0, 197, "キャル", 106001, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 37, 0, 0, 198, "キャル", 106001, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 38, 0, 0, 199, "キャル", 106001, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 20, 0, 0, 200, "コッコロ", 105901, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 21, 0, 0, 201, "コッコロ", 105901, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 22, 0, 0, 202, "コッコロ", 105901, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 23, 0, 0, 203, "コッコロ", 105901, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 24, 0, 0, 204, "コッコロ", 105901, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 25, 0, 0, 205, "コッコロ", 105901, "オイッスー☆", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 26, 0, 0, 206, "コッコロ", 105901, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 27, 0, 0, 207, "コッコロ", 105901, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 28, 0, 0, 208, "コッコロ", 105901, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 20, 0, 0, 209, "ペコリーヌ", 105801, "オイッスー☆", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 21, 0, 0, 210, "ペコリーヌ", 105801, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 22, 0, 0, 211, "ペコリーヌ", 105801, "あと６日で2.5周年ですか…", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 23, 0, 0, 212, "ペコリーヌ", 105801, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 24, 0, 0, 213, "ペコリーヌ", 105801, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 25, 0, 0, 214, "ペコリーヌ", 105801, "オイッスー☆", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 26, 0, 0, 215, "ペコリーヌ", 105801, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 27, 0, 0, 216, "ペコリーヌ", 105801, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 28, 0, 0, 217, "ペコリーヌ", 105801, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 29, 0, 0, 218, "ペコリーヌ", 105801, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 30, 0, 0, 219, "ペコリーヌ", 105801, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 31, 0, 0, 220, "ペコリーヌ", 105801, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 29, 1, 0, 221, "コッコロ", 105901, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 32, 0, 0, 222, "ペコリーヌ", 105801, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 39, 2, 0, 223, "キャル", 106001, "…………", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 30, 1, 0, 224, "コッコロ", 105901, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 40, 2, 0, 225, "キャル", 106001, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 33, 0, 0, 226, "ペコリーヌ", 105801, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 41, 2, 0, 227, "キャル", 106001, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 34, 0, 0, 228, "ペコリーヌ", 105801, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 35, 0, 0, 229, "ペコリーヌ", 105801, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 42, 2, 0, 230, "キャル", 106001, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 31, 1, 0, 231, "コッコロ", 105901, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 43, 2, 0, 232, "キャル", 106001, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 36, 0, 0, 233, "ペコリーヌ", 105801, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 6, 0, 0, 234, "カリン", 190801, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 7, 0, 0, 235, "カリン", 190801, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 8, 0, 0, 236, "カリン", 190801, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 9, 0, 0, 237, "カリン", 190801, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 10, 0, 0, 238, "カリン", 190801, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 11, 0, 0, 239, "カリン", 190801, "次にコッコロさんですが\nこちらは発声練習をしています", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 12, 0, 0, 240, "カリン", 190801, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 13, 0, 0, 241, "カリン", 190801, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 14, 0, 0, 242, "カリン", 190801, "あれ？\nもしかして緊張で気を失って…？", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 15, 0, 0, 243, "カリン", 190801, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 16, 0, 0, 244, "カリン", 190801, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 17, 0, 0, 245, "カリン", 190801, "それでは\nまた明日お会いしましょう♪", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 44, 0, 0, 246, "キャル", 106001, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 37, 2, 0, 247, "ペコリーヌ", 105801, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 32, 1, 0, 248, "コッコロ", 105901, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 45, 0, 0, 249, "キャル", 106001, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 38, 2, 0, 250, "ペコリーヌ", 105801, "ひどいですよぉキャルちゃ～ん！", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 33, 1, 0, 251, "コッコロ", 105901, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 39, 2, 0, 252, "ペコリーヌ", 105801, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 46, 0, 0, 253, "キャル", 106001, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 34, 1, 0, 254, "コッコロ", 105901, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 40, 2, 0, 255, "ペコリーヌ", 105801, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 41, 0, 0, 256, "ペコリーヌ", 105801, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 47, 2, 0, 257, "キャル", 106001, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 42, 0, 0, 258, "ペコリーヌ", 105801, "忘れてきちゃいました☆", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 48, 2, 0, 259, "キャル", 106001, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 35, 1, 0, 260, "コッコロ", 105901, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 49, 2, 0, 261, "キャル", 106001, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 43, 0, 0, 262, "ペコリーヌ", 105801, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 50, 2, 0, 263, "キャル", 106001, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 36, 1, 0, 264, "コッコロ", 105901, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 51, 2, 0, 265, "キャル", 106001, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 37, 1, 0, 266, "コッコロ", 105901, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 52, 2, 0, 267, "キャル", 106001, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 44, 0, 0, 268, "ペコリーヌ", 105801, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 38, 1, 0, 269, "コッコロ", 105901, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 45, 0, 0, 270, "ペコリーヌ", 105801, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 53, 2, 0, 271, "キャル", 106001, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 46, 0, 0, 272, "ペコリーヌ", 105801, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 18, 0, 0, 273, "カリン", 190801, "こんにちは\n【ギルド管理協会】のカリンです", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 19, 0, 0, 274, "カリン", 190801, "昨日の生放送は\nいかがだったでしょうか？", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 20, 0, 0, 275, "カリン", 190801, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 21, 0, 0, 276, "カリン", 190801, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 22, 0, 0, 277, "カリン", 190801, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 23, 0, 0, 278, "カリン", 190801, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 24, 0, 0, 279, "カリン", 190801, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 25, 0, 0, 280, "カリン", 190801, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 26, 0, 0, 281, "カリン", 190801, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 27, 0, 0, 282, "カリン", 190801, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 47, 0, 0, 283, "ペコリーヌ", 105801, "準備はいいですかっ？\n…いっきますよー！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 54, 2, 0, 284, "キャル", 106001, "祝！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 39, 1, 0, 285, "コッコロ", 105901, "2.5周年！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 48, 0, 0, 286, "ペコリーヌ", 105801, "おめでとうございま～す☆", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 55, 2, 0, 287, "キャル", 106001, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 40, 1, 0, 288, "コッコロ", 105901, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 49, 0, 0, 289, "ペコリーヌ", 105801, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 56, 2, 0, 290, "キャル", 106001, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 41, 1, 0, 291, "コッコロ", 105901, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 57, 2, 0, 292, "キャル", 106001, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 50, 0, 0, 293, "ペコリーヌ", 105801, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 58, 2, 0, 294, "キャル", 106001, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 51, 0, 0, 295, "ペコリーヌ", 105801, "記念日だから\n平気平気♪\nやばいですね☆", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 59, 2, 0, 296, "キャル", 106001, "意味分かんないわよ！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 42, 1, 0, 297, "コッコロ", 105901, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 43, 1, 0, 298, "コッコロ", 105901, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 52, 0, 0, 299, "ペコリーヌ", 105801, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 60, 2, 0, 300, "キャル", 106001, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 44, 1, 0, 301, "コッコロ", 105901, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80003, "", 53, 0, 0, 302, "ペコリーヌ", 105801, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, 80003, "105901,45,106001,61", 54, 0, 0, 303, "ペコリーヌ・コッコロ・キャル", 105801, "2.5周年\nありがとうございます！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60002, "", 1, 1, 1, 304, "カリン", 190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60002, "", 0, 2, 1, 305, "", 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60002, "", 0, 2, 1, 306, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60002, "", 0, 2, 1, 307, "", 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60002, "", 0, 2, 1, 308, "", 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60002, "", 0, 2, 2, 309, "", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60002, "", 0, 2, 1, 310, "", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60002, "", 0, 2, 1, 311, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60002, "", 0, 2, 1, 312, "", 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60002, "", 0, 2, 1, 313, "", 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60002, "", 0, 2, 2, 314, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60002, "", 0, 2, 1, 315, "", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60002, "", 0, 2, 1, 316, "", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60002, "", 0, 2, 1, 317, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60002, "", 0, 2, 1, 318, "", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60002, "", 0, 2, 1, 319, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60002, "", 0, 2, 1, 320, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60002, "", 0, 2, 2, 321, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60002, "", 0, 2, 1, 322, "", 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60002, "", 0, 2, 1, 323, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60002, "", 0, 2, 1, 324, "", 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60002, "", 0, 2, 1, 325, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60002, "", 0, 2, 1, 326, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60002, "", 0, 2, 1, 327, "", 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60002, "", 0, 2, 2, 328, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60002, "", 2, 3, 0, 329, "カリン", 190804, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60002, "", 3, 3, 0, 330, "カリン", 190804, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 1, 4, 0, 331, "コッコロ", 105901, "ささ、シェフィさまはこちらへ…", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 1, 0, 0, 332, "シェフィ", 106401, "コッコロさん、どこへ行くの…？\n…え？", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 1, 3, 0, 333, "ペコリーヌ", 105801, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 2, 4, 0, 334, "コッコロ", 105901, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 2, 0, 0, 335, "シェフィ", 106401, "ええと…\n二人とも何をしているの？", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 1, 1, 0, 336, "キャル", 106001, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 3, 0, 0, 337, "シェフィ", 106401, "あの日…？", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 2, 3, 0, 338, "ペコリーヌ", 105801, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 3, 3, 0, 339, "ペコリーヌ", 105801, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 1, 2, 0, 340, "カリン", 190801, "やばいですね☆", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 2, 1, 0, 341, "キャル", 106001, "って、なにしれっと\n参加してんのよカリン！", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 2, 2, 0, 342, "カリン", 190801, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 3, 2, 0, 343, "カリン", 190801, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 4, 3, 0, 344, "ペコリーヌ", 105801, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 4, 0, 0, 345, "シェフィ", 106401, "えっ！？　ええとええと…！\nあ、あと14日…！", 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 5, 3, 0, 346, "ペコリーヌ", 105801, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 3, 1, 0, 347, "コッコロ", 105901, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 4, 1, 0, 348, "コッコロ", 105901, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 6, 3, 0, 349, "ペコリーヌ", 105801, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 5, 1, 0, 350, "コッコロ", 105901, "さすがでございます\nペコリーヌさま", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 3, 0, 0, 351, "キャル", 106001, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 5, 2, 0, 352, "シェフィ", 106401, "しゃなり、しゃなり…\nふふ、案外できるものね", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 7, 3, 0, 353, "ペコリーヌ", 105801, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 6, 1, 0, 354, "コッコロ", 105901, "さ、次はキャルさまの\n番でございますよ", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 4, 0, 0, 355, "キャル", 106001, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 6, 2, 0, 356, "シェフィ", 106401, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 5, 0, 0, 357, "キャル", 106001, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 6, 0, 0, 358, "キャル", 106001, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 7, 1, 0, 359, "コッコロ", 105901, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 7, 0, 0, 360, "キャル", 106001, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 8, 1, 0, 361, "コッコロ", 105901, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 8, 3, 0, 362, "ペコリーヌ", 105801, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 9, 1, 0, 363, "コッコロ", 105901, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 7, 2, 0, 364, "シェフィ", 106401, "聖学祭…って、なにかしら？", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 10, 1, 0, 365, "コッコロ", 105901, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 8, 0, 0, 366, "キャル", 106001, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 9, 0, 0, 367, "キャル", 106001, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 9, 3, 0, 368, "ペコリーヌ", 105801, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 10, 0, 0, 369, "キャル", 106001, "いや、そのまんますぎでしょ…", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 8, 2, 0, 370, "シェフィ", 106401, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 10, 3, 0, 371, "ペコリーヌ", 105801, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 9, 2, 0, 372, "シェフィ", 106401, "えっ？　ええ…\nぎゅーっ…？", 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 11, 0, 0, 373, "キャル", 106001, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 10, 2, 0, 374, "シェフィ", 106401, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 12, 0, 0, 375, "キャル", 106001, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 11, 1, 0, 376, "コッコロ", 105901, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 13, 0, 0, 377, "キャル", 106001, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 11, 3, 0, 378, "ペコリーヌ", 105801, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 14, 0, 0, 379, "キャル", 106001, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 15, 0, 0, 380, "キャル", 106001, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 11, 2, 0, 381, "シェフィ", 106401, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 12, 3, 0, 382, "ペコリーヌ", 105801, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 12, 1, 0, 383, "コッコロ", 105901, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 16, 0, 0, 384, "キャル", 106001, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 12, 2, 0, 385, "シェフィ", 106401, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 13, 3, 0, 386, "ペコリーヌ", 105801, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 14, 3, 0, 387, "ペコリーヌ", 105801, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 15, 3, 0, 388, "ペコリーヌ", 105801, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 17, 0, 0, 389, "キャル", 106001, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 18, 0, 0, 390, "キャル", 106001, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 13, 2, 0, 391, "シェフィ", 106401, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 13, 1, 0, 392, "コッコロ", 105901, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 16, 3, 0, 393, "ペコリーヌ", 105801, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 19, 0, 0, 394, "キャル", 106001, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 17, 3, 0, 395, "ペコリーヌ", 105801, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 18, 3, 0, 396, "ペコリーヌ", 105801, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 19, 3, 0, 397, "ペコリーヌ", 105801, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 5);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 4, 2, 0, 398, "カリン", 190801, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 5, 2, 0, 399, "カリン", 190801, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 20, 1, 0, 400, "キャル", 106001, "…えっ！？", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 20, 3, 0, 401, "ペコリーヌ", 105801, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 14, 0, 0, 402, "シェフィ", 106401, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 14, 4, 0, 403, "コッコロ", 105901, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 15, 0, 0, 404, "シェフィ", 106401, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 21, 1, 0, 405, "キャル", 106001, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 21, 3, 0, 406, "ペコリーヌ", 105801, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 22, 1, 0, 407, "キャル", 106001, "ぶっ殺すぞ！？", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 6, 2, 0, 408, "カリン", 190801, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 15, 1, 0, 409, "コッコロ", 105901, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 23, 0, 0, 410, "キャル", 106001, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 16, 2, 0, 411, "シェフィ", 106401, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 22, 3, 0, 412, "ペコリーヌ", 105801, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 24, 0, 0, 413, "キャル", 106001, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 17, 2, 0, 414, "シェフィ", 106401, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 16, 1, 0, 415, "コッコロ", 105901, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 18, 2, 0, 416, "シェフィ", 106401, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 17, 1, 0, 417, "コッコロ", 105901, "もちろんでございます\n仲良くお勉強いたしましょう", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 25, 0, 0, 418, "キャル", 106001, "しれっと教育ママが\n生まれてる…？", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 23, 3, 0, 419, "ペコリーヌ", 105801, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 26, 0, 0, 420, "キャル", 106001, "え～～～～！？", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 27, 0, 0, 421, "キャル", 106001, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 19, 2, 0, 422, "シェフィ", 106401, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 18, 1, 0, 423, "コッコロ", 105901, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 24, 3, 0, 424, "ペコリーヌ", 105801, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 20, 2, 0, 425, "シェフィ", 106401, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 28, 0, 0, 426, "キャル", 106001, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 19, 1, 0, 427, "コッコロ", 105901, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 21, 2, 0, 428, "シェフィ", 106401, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 29, 0, 0, 429, "キャル", 106001, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 30, 0, 0, 430, "キャル", 106001, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 25, 3, 0, 431, "ペコリーヌ", 105801, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 31, 0, 0, 432, "キャル", 106001, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 8);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 22, 0, 0, 433, "シェフィ", 106401, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 23, 0, 0, 434, "シェフィ", 106401, "…えっ？\n生放送の意気込み！？\n突然なに！？", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 24, 0, 0, 435, "シェフィ", 106401, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 25, 0, 0, 436, "シェフィ", 106401, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 26, 0, 0, 437, "シェフィ", 106401, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 27, 0, 0, 438, "シェフィ", 106401, "それから、それから…！\nぅ、ぅぅっ…！", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 28, 0, 0, 439, "シェフィ", 106401, "―びえぇぇ～んっ！！！", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 20, 1, 0, 440, "コッコロ", 105901, "どうされましたか、シェフィさま", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 29, 0, 0, 441, "シェフィ", 106401, "ううっ…ひっく…\nママッ…！", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 21, 1, 0, 442, "コッコロ", 105901, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 22, 1, 0, 443, "コッコロ", 105901, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 30, 0, 0, 444, "シェフィ", 106401, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 9);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 23, 0, 0, 445, "コッコロ", 105901, "主さま\n3.5周年まであと５日\nでございます", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 24, 0, 0, 446, "コッコロ", 105901, "ですがその前に\n生放送がありますね", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 25, 0, 0, 447, "コッコロ", 105901, "…生放送に向けた\n意気込みでございますか？", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 26, 0, 0, 448, "コッコロ", 105901, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 27, 0, 0, 449, "コッコロ", 105901, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 28, 0, 0, 450, "コッコロ", 105901, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 29, 0, 0, 451, "コッコロ", 105901, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 30, 0, 0, 452, "コッコロ", 105901, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 31, 0, 0, 453, "コッコロ", 105901, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 10);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 26, 0, 0, 454, "ペコリーヌ", 105801, "3.5周年まであと４日！\nやばいですね☆", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 32, 1, 0, 455, "キャル", 106001, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 27, 0, 0, 456, "ペコリーヌ", 105801, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 28, 0, 0, 457, "ペコリーヌ", 105801, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 29, 0, 0, 458, "ペコリーヌ", 105801, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 33, 1, 0, 459, "キャル", 106001, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 30, 0, 0, 460, "ペコリーヌ", 105801, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 31, 0, 0, 461, "ペコリーヌ", 105801, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 32, 0, 0, 462, "ペコリーヌ", 105801, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 34, 1, 0, 463, "キャル", 106001, "だからあたしはやるなんて一言も…", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 33, 0, 0, 464, "ペコリーヌ", 105801, "オイッスー☆", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 35, 1, 0, 465, "キャル", 106001, "聞きなさいっての！！", 11);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 31, 2, 0, 466, "シェフィ", 106401, "3.5周年まであと３日…\nそして生放送は、明日…", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 32, 2, 0, 467, "シェフィ", 106401, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 33, 2, 0, 468, "シェフィ", 106401, "おいっす！\n…こうじゃなかったわね\nええと確か…", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 34, 2, 0, 469, "シェフィ", 106401, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 35, 2, 0, 470, "シェフィ", 106401, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 34, 3, 0, 471, "ペコリーヌ", 105801, "やってますねシェフィちゃん！", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 36, 0, 0, 472, "キャル", 106001, "なによ、考えることは\nみんな同じってこと？", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 32, 1, 0, 473, "コッコロ", 105901, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 36, 2, 0, 474, "シェフィ", 106401, "みんな…もちろんよ！", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 35, 3, 0, 475, "ペコリーヌ", 105801, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 12);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 7, 2, 0, 476, "カリン", 190801, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 8, 2, 0, 477, "カリン", 190801, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 36, 3, 0, 478, "ペコリーヌ", 105801, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 9, 2, 0, 479, "カリン", 190801, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 33, 4, 0, 480, "コッコロ", 105901, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 10, 2, 0, 481, "カリン", 190801, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 37, 1, 0, 482, "キャル", 106001, "大丈夫…大丈夫…\nあたしは大丈夫…", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 11, 2, 0, 483, "カリン", 190801, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 37, 0, 0, 484, "シェフィ", 106401, "あうー？", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, 80005, "105901,34,106001,38,190801,12", 37, 4, 0, 485, "みんな", 105801, "あ…", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 39, 1, 0, 486, "キャル", 106001, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 35, 4, 0, 487, "コッコロ", 105901, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 38, 3, 0, 488, "ペコリーヌ", 105801, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 13, 2, 0, 489, "カリン", 190801, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 38, 2, 0, 490, "シェフィ", 106401, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 39, 3, 0, 491, "ペコリーヌ", 105801, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 40, 0, 0, 492, "キャル", 106001, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 36, 1, 0, 493, "コッコロ", 105901, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 39, 2, 0, 494, "シェフィ", 106401, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 40, 3, 0, 495, "ペコリーヌ", 105801, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 37, 1, 0, 496, "コッコロ", 105901, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 41, 0, 0, 497, "キャル", 106001, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 40, 2, 0, 498, "シェフィ", 106401, "へ、へぇ…", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 41, 3, 0, 499, "ペコリーヌ", 105801, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 41, 2, 0, 500, "シェフィ", 106401, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 42, 2, 0, 501, "シェフィ", 106401, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 14);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 42, 3, 0, 502, "ペコリーヌ", 105801, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 42, 1, 0, 503, "キャル", 106001, "祝！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 38, 4, 0, 504, "コッコロ", 105901, "3.5周年！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 43, 0, 0, 505, "シェフィ", 106401, "おめでとうございます！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 14, 2, 0, 506, "カリン", 190801, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 15, 2, 0, 507, "カリン", 190801, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 43, 3, 0, 508, "ペコリーヌ", 105801, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 44, 3, 0, 509, "ペコリーヌ", 105801, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 43, 1, 0, 510, "キャル", 106001, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 44, 1, 0, 511, "キャル", 106001, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 44, 0, 0, 512, "シェフィ", 106401, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 45, 0, 0, 513, "シェフィ", 106401, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 39, 4, 0, 514, "コッコロ", 105901, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 40, 4, 0, 515, "コッコロ", 105901, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 41, 4, 0, 516, "コッコロ", 105901, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 80005, "", 45, 3, 0, 517, "ペコリーヌ", 105801, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, 80005, "105901,42,106001,45,106401,46,190801,16", 46, 4, 0, 518, "みんな", 105801, "これからも\nよろしくおねがいします！", 15);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60003, "", 1, 1, 1, 519, "カリン", 190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60003, "", 0, 2, 1, 520, "", 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60003, "", 0, 2, 1, 521, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60003, "", 0, 2, 1, 522, "", 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60003, "", 0, 2, 1, 523, "", 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60003, "", 0, 2, 2, 524, "", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60003, "", 0, 2, 1, 525, "", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60003, "", 0, 2, 1, 526, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60003, "", 0, 2, 1, 527, "", 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60003, "", 0, 2, 1, 528, "", 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60003, "", 0, 2, 2, 529, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60003, "", 0, 2, 1, 530, "", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60003, "", 0, 2, 1, 531, "", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60003, "", 0, 2, 1, 532, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60003, "", 0, 2, 1, 533, "", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60003, "", 0, 2, 1, 534, "", 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60003, "", 0, 2, 1, 535, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60003, "", 0, 2, 2, 536, "", 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60003, "", 0, 2, 1, 537, "", 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60003, "", 0, 2, 1, 538, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60003, "", 0, 2, 1, 539, "", 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60003, "", 0, 2, 1, 540, "", 0, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60003, "", 0, 2, 1, 541, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60003, "", 0, 2, 1, 542, "", 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60003, "", 0, 2, 2, 543, "", 0, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60003, "", 2, 3, 0, 544, "カリン", 190804, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60003, "", 3, 3, 0, 545, "カリン", 190804, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60004, "", 1, 1, 1, 546, "カリン", 190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60004, "", 0, 2, 1, 547, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60004, "", 0, 2, 1, 548, "", 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60004, "", 0, 2, 1, 549, "", 0, "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60004, "", 0, 2, 1, 550, "", 0, "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60004, "", 0, 2, 1, 551, "", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60004, "", 0, 2, 1, 552, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60004, "", 0, 2, 2, 553, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60004, "", 0, 2, 1, 554, "", 0, "今日の運勢は大吉！　ラッキーワードは「ぴょんぴょん♪」\nおっきな声で一緒に言ってみよ～♪　うさぎさんぴょんぴょ～ん♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60004, "", 0, 2, 1, 555, "", 0, "今日の運勢は大吉！　あなたの趣味がもっと広がるかも！\nかんわゆ～～～いショタと～騎士きゅんもゲット～んふふ～♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60004, "", 0, 2, 1, 556, "", 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60004, "", 0, 2, 1, 557, "", 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60004, "", 0, 2, 2, 558, "", 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60004, "", 0, 2, 1, 559, "", 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60004, "", 0, 2, 1, 560, "", 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60004, "", 0, 2, 1, 561, "", 0, "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60004, "", 0, 2, 1, 562, "", 0, "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, 60004, "", 0, 2, 1, 563, "", 0, "今日の運勢は中吉！　誰かに尽くすことで掴める幸せもあるかも？\n人事を尽くして天命を待つ！　さ、年始もバリバリ働きますわよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60004, "", 0, 2, 1, 564, "", 0, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60004, "", 0, 2, 1, 565, "", 0, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60004, "", 0, 2, 1, 566, "", 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60004, "", 0, 2, 2, 567, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60004, "", 0, 2, 1, 568, "", 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60004, "", 0, 2, 1, 569, "", 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, 60004, "", 0, 2, 2, 570, "", 0, "今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60004, "", 2, 3, 0, 571, "カリン", 190804, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60004, "", 3, 3, 0, 572, "カリン", 190804, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, 60005, "", 1, 1, 1, 573, "カリン", 190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60005, "", 0, 2, 1, 574, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60005, "", 0, 2, 1, 575, "", 0, "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60005, "", 0, 2, 2, 576, "", 0, "今日の運勢は姫吉！　道を歩けば幸運に当たる、最高の吉日！　　さすがは兄様。尽善尽美、金甌無欠の強運をお持ちですね。", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60005, "", 0, 2, 2, 577, "", 0, "今日の運勢は姫吉！　旅立ち、どこへ行くもよし！　　　　　　　新年の門出も、お兄さんと一緒です♪　冒険にしゅっぱーつ♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, 60005, "", 0, 2, 2, 578, "", 0, "今日の運勢は姫吉！　一日三食食べれば健康運アップ！　　　　　おせち。おぞうに。もっと、たべよ？　お兄。", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60005, "", 0, 2, 1, 579, "", 0, "今日の運勢は大吉！　あなたの趣味がもっと広がるかも！\nかんわゆ～～～いショタと～騎士きゅんもゲット～んふふ～♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60005, "", 0, 2, 1, 580, "", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60005, "", 0, 2, 1, 581, "", 0, "今日の運勢は大吉！　日々の努力が実り、何事も良い方向へ！　　そんな弟くんには、お姉ちゃんのよしよしぎゅ～っをプレゼント♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60005, "", 0, 2, 2, 582, "", 0, "今日の運勢は大吉！　お出かけするといいことあるかも？　　　　また一緒に、お忍びデートしてくださいね……騎士♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, 60005, "", 0, 2, 2, 583, "", 0, "今日の運勢は大吉！　転居するならあたたかい場所が吉！　　　　煉獄の世なれど、住めば都と申しんす。ゆるりときなんせ……♪", 0);
